import React from "react";
import {add, sub, mult, div} from "./Calc";

function Aapp() {
    return (
        <>
        <ul>
        <li>{add(10,15)}</li>
        <li>{sub(50,6)}</li>
        <li>{mult(2,5)}</li>
        <li>{div(16,3)}</li>
        </ul>
        </>
    );
}
export default Aapp;
